#include <Arduino.h>
#include <FS.h>
#include "SPIFFS.h"
#include <LovyanGFX_DentaroUI.hpp>
#include <map>
#include <iostream>


uint32_t cnt = ~0;

// 準備したクラスのインスタンスを作成します。
LGFX screen;
// LovyanGFX_DentaroUI ui(&screen);
LGFX_Sprite tft(&screen);


extern const uint16_t imgWidth;
extern const uint16_t imgHeight;
extern const unsigned short img[];

void setup(void)
{
  Serial.begin(115200);
  // SPIバスとパネルの初期化を実行すると使用可能になります。

  tft.setPsram( true );//DMA利用のためPSRAMは切る
  tft.createSprite( 480, 480 );
  tft.startWrite();//CSアサート開始
  
  screen.init();
  // screen.invertDisplay(true);
  // screen.begin();
  
  screen.clear(TFT_BLACK);

  screen.setTextSize((std::max(screen.width(), screen.height()) + 255) >> 8);

  // タッチが使用可能な場合のキャリブレーションを行います。（省略可）
  if (screen.touch())
  {
    
    if (screen.width() < screen.height()) screen.setRotation(screen.getRotation() ^ 1);

    // 画面に案内文章を描画します。
    screen.setTextDatum(textdatum_t::middle_center);
    screen.drawString("touch the arrow marker.", screen.width()>>1, screen.height() >> 1);
    screen.setTextDatum(textdatum_t::top_left);

    // タッチを使用する場合、キャリブレーションを行います。画面の四隅に表示される矢印の先端を順にタッチしてください。
    std::uint16_t fg = TFT_WHITE;
    std::uint16_t bg = TFT_BLACK;
    if (screen.isEPD()) std::swap(fg, bg);
    screen.calibrateTouch(nullptr, fg, bg, std::max(screen.width(), screen.height()) >> 3);
    // Serial.println(fg);
  }

}


void loop(void)
{
  // tft.fillScreen(TFT_RED);

  // Serial.println("HelloWorld IO");
  // delay(2000);

  tft.startWrite();
  // tft.setRotation(++cnt & 7);
  tft.setColorDepth((cnt & 8) ? 16 : 24);

  tft.setTextColor(TFT_WHITE);
  tft.drawNumber(tft.getRotation(), 16, 0);

  tft.setTextColor(0xFF0000U);
  tft.drawString("R", 30, 16);
  tft.setTextColor(0x00FF00U);
  tft.drawString("G", 40, 16);
  tft.setTextColor(0x0000FFU);
  tft.drawString("B", 50, 16);

  tft.drawRect(30,30,tft.width()-60,tft.height()-60,cnt*7);
  tft.drawFastHLine(0, 0, 10);

  tft.endWrite();
  screen.invertDisplay(true);

  int32_t x, y;
  if (screen.getTouch(&x, &y)) {
    tft.fillRect(x-25, y-25, 50, 50, cnt*7);
  }

  int ix = rand() % tft.width();
  int iy = rand() % tft.height();
  tft.pushImage(ix, iy, imgWidth, imgHeight, img);
  delay(1);

  tft.setPivot(0, 0);
  tft.pushRotateZoom(&screen, 0, 0, 0, 1, 1);
}

